INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (401, "2020/07/31 12:00:00", "アヤネ", 10046, "2030/12/17 14:59:59", 0.0, 102301, 24001, 2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (402, "2020/07/31 12:00:00", "アヤネ", 10046, "2030/12/17 14:59:59", 2.21, 102301, 24002, 1, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (403, "2020/07/31 12:00:00", "アヤネ", 10046, "2030/12/17 14:59:59", 0.0, 102301, 24003, 2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (701, "2020/07/31 12:00:00", "アサヒ", 10046, "2030/12/17 14:59:59", 1.99, 192201, 24004, 2, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (702, "2020/07/31 12:00:00", "アサヒ", 10046, "2030/12/17 14:59:59", 2.21, 192201, 24005, 1, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (703, "2020/07/31 12:00:00", "アサヒ", 10046, "2030/12/17 14:59:59", 3.33, 192201, 24006, 2, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (801, "2020/07/31 12:00:00", "部員３", 10046, "2030/12/17 14:59:59", 0.0, 192301, 24007, 2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (802, "2020/07/31 12:00:00", "部員３", 10046, "2030/12/17 14:59:59", 2.68, 192301, 24008, 1, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (803, "2020/07/31 12:00:00", "部員３", 10046, "2030/12/17 14:59:59", 0.0, 192301, 24009, 2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (501, "2020/07/31 12:00:00", "", 10046, "2030/12/17 14:59:59", 0.0, 192501, 24010, 1, 0.0, "やった！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (502, "2020/07/31 12:00:00", "", 10046, "2030/12/17 14:59:59", 0.0, 192501, 24011, 1, 0.0, "勝ったよ！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (503, "2020/07/31 12:00:00", "", 10046, "2030/12/17 14:59:59", 0.0, 192501, 24012, 1, 0.0, "いい調子！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (111, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 5.33, 113501, 24013, 6, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (112, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 6.85, 113501, 24014, 1, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (113, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 3.0, 113501, 24015, 1, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (611, "2020/07/31 12:00:00", "ダイチ", 10046, "2030/12/17 14:59:59", 6.11, 192401, 24016, 1, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (612, "2020/07/31 12:00:00", "ダイチ", 10046, "2030/12/17 14:59:59", 6.75, 192401, 24017, 1, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (613, "2020/07/31 12:00:00", "ダイチ", 10046, "2030/12/17 14:59:59", 0.0, 192401, 24018, 2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (211, "2020/07/31 12:00:00", "ハツネ", 10046, "2030/12/17 14:59:59", 4.52, 113401, 24019, 2, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (212, "2020/07/31 12:00:00", "ハツネ", 10046, "2030/12/17 14:59:59", 3.89, 113401, 24020, 2, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (213, "2020/07/31 12:00:00", "ハツネ", 10046, "2030/12/17 14:59:59", 13.49, 113401, 24021, 1, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (311, "2020/07/31 12:00:00", "カヤ", 10046, "2030/12/17 14:59:59", 3.17, 106501, 24022, 1, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (312, "2020/07/31 12:00:00", "カヤ", 10046, "2030/12/17 14:59:59", 4.42, 106501, 24023, 1, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (313, "2020/07/31 12:00:00", "カヤ", 10046, "2030/12/17 14:59:59", 2.89, 106501, 24024, 6, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (421, "2020/07/31 12:00:00", "アヤネ", 10046, "2030/12/17 14:59:59", 3.71, 102301, 24025, 4, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24, 0.0, 3);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (721, "2020/07/31 12:00:00", "アサヒ", 10046, "2030/12/17 14:59:59", 5.1, 192201, 24026, 2, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (821, "2020/07/31 12:00:00", "部員３", 10046, "2030/12/17 14:59:59", 4.34, 192301, 24027, 1, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24, 0.0, 3);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (521, "2020/07/31 12:00:00", "", 10046, "2030/12/17 14:59:59", 0.0, 192501, 24028, 1, 0.0, "いい勝負だったよ\nまたやろうね", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (101, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 5.62, 113501, 24029, 1, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (102, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 9.58, 113501, 24030, 1, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (103, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 0.0, 113501, 24031, 2, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24, 0.0, 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (104, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 9.13, 113501, 24032, 2, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24, 0.0, 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (105, "2020/07/31 12:00:00", "ミサト", 10046, "2030/12/17 14:59:59", 8.27, 113501, 24033, 1, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24, 0.0, 2);
